static void _container_free(netsnmp_container *container);

/**
 * @internal
 */
static int
_cache_load(netsnmp_cache *cache, void *vmagic)
{
    DEBUGMSGTL(("internal:trafficProcessorTable:_cache_load","called\n"));

    if((NULL == cache) || (NULL == cache->magic)) {
        snmp_log(LOG_ERR, "invalid cache for trafficProcessorTable_cache_load\n");
        return -1;
    }

    /** should only be called for an invalid or expired cache */
    netsnmp_assert((0 == cache->valid) || (1 == cache->expired));
    
    /*
     * call user code
     */
    return trafficProcessorTable_container_load((netsnmp_container*)cache->magic);
} /* _cache_load */

/**
 * @internal
 */
static void
_cache_free(netsnmp_cache *cache, void *magic)
{
    netsnmp_container *container;

    DEBUGMSGTL(("internal:trafficProcessorTable:_cache_free","called\n"));

    if((NULL == cache) || (NULL == cache->magic)) {
        snmp_log(LOG_ERR, "invalid cache in trafficProcessorTable_cache_free\n");
        return;
    }

    container = (netsnmp_container*)cache->magic;

    _container_free(container);
} /* _cache_free */

/**
 * @internal
 */
static void
_container_item_free(trafficProcessorTable_rowreq_ctx *rowreq_ctx, void *context)
{
    DEBUGMSGTL(("internal:trafficProcessorTable:_container_item_free","called\n"));

    if(NULL == rowreq_ctx)
        return;

    trafficProcessorTable_release_rowreq_ctx(rowreq_ctx);
} /* _container_item_free */

/**
 * @internal
 */
static void
_container_free(netsnmp_container *container)
{
    DEBUGMSGTL(("internal:trafficProcessorTable:_container_free","called\n"));

    if (NULL == container) {
        snmp_log(LOG_ERR, "invalid container in trafficProcessorTable_container_free\n");
        return;
    }

    /*
     * call user code
     */
    trafficProcessorTable_container_free(container);
    
    /*
     * free all items. inefficient, but easy.
     */
    CONTAINER_CLEAR(container,
                    (netsnmp_container_obj_func *)_container_item_free,
                    NULL);
} /* _container_free */

/**
 * @internal
 * initialize the container with functions or wrappers
 */
void
_trafficProcessorTable_container_init(trafficProcessorTable_interface_ctx *if_ctx)
{
    DEBUGMSGTL(("internal:trafficProcessorTable:_trafficProcessorTable_container_init","called\n"));

    /*
     * cache init
     */
    if_ctx->cache = netsnmp_cache_create(30, /* timeout in seconds */
                                         _cache_load, _cache_free,
                                         trafficProcessorTable_oid,
                                         trafficProcessorTable_oid_size);

    if(NULL == if_ctx->cache) {
        snmp_log(LOG_ERR, "error creating cache for trafficProcessorTable\n");
        return;
    }

    if_ctx->cache->flags = NETSNMP_CACHE_DONT_INVALIDATE_ON_SET;

    trafficProcessorTable_container_init(&if_ctx->container, if_ctx->cache);
    if(NULL == if_ctx->container)
        if_ctx->container = netsnmp_container_find("trafficProcessorTable:table_container");
    if(NULL == if_ctx->container) {
        snmp_log(LOG_ERR,"error creating container in "
                 "trafficProcessorTable_container_init\n");
        return;
    }

    if (NULL != if_ctx->cache)
        if_ctx->cache->magic = (void*)if_ctx->container;
} /* _trafficProcessorTable_container_init */

/**
 * @internal
 * shutdown the container with functions or wrappers
 */
void
_trafficProcessorTable_container_shutdown(trafficProcessorTable_interface_ctx *if_ctx)
{
    DEBUGMSGTL(("internal:trafficProcessorTable:_trafficProcessorTable_container_shutdown","called\n"));

    trafficProcessorTable_container_shutdown(if_ctx->container);

    _container_free(if_ctx->container);

} /* _trafficProcessorTable_container_shutdown */


trafficProcessorTable_rowreq_ctx *
trafficProcessorTable_row_find_by_mib_index(trafficProcessorTable_mib_index *mib_idx)
{
    trafficProcessorTable_rowreq_ctx   *rowreq_ctx;
    oid                      oid_tmp[MAX_OID_LEN];
    netsnmp_index            oid_idx;
    int                      rc;

    /*
     * set up storage for OID
     */
    oid_idx.oids = oid_tmp;
    oid_idx.len = sizeof(oid_tmp)/sizeof(oid);

    /*
     * convert
     */
    rc = trafficProcessorTable_index_to_oid(&oid_idx, mib_idx);
    if (MFD_SUCCESS != rc)
        return NULL;

    rowreq_ctx = (trafficProcessorTable_rowreq_ctx*)CONTAINER_FIND(trafficProcessorTable_if_ctx.container, &oid_idx);

    return rowreq_ctx;
}

